import './App.css';
import RecipeGallery from './RecipeGallery';

const recipes = [
  {id: 1, title: "Spaghetti Carbonara", ingredients: ["Pasta", "Eggs", "Cheese", "Bacon"], image: "https://example.com/carbonara.jpg"},
  {id: 2, title: "Spaghetti Carbonara", ingredients: ["Pasta", "Eggs", "Cheese", "Bacon"], image: "https://example.com/carbonara.jpg"},
  {id: 3, title: "Spaghetti Carbonara", ingredients: ["Pasta", "Eggs", "Cheese", "Bacon"], image: "https://example.com/carbonara.jpg"},
  {id: 4, title: "Spaghetti Carbonara", ingredients: ["Pasta", "Eggs", "Cheese", "Bacon"], image: "https://example.com/carbonara.jpg"},
  {id: 5, title: "Spaghetti Carbonara", ingredients: ["Pasta", "Eggs", "Cheese", "Bacon"], image: "https://example.com/carbonara.jpg"}
];

const recipeList = (
  <ul>
   {recipes.map(recipe => {
    <li key = {recipe.id}>
      {recipe.title} : {recipe.ingredients}  {recipe.image}
    </li>
   })}
  </ul>
)

function App() {
  return (
    <RecipeGallery recipes = {recipes}/>
  );
}

export default App;
